import React from 'react';
import Project from "./Project";
import {Grid} from "@mui/material";
import {ProjectNav} from "./ProjectNav";

export default function ProjectsList({ projects }) {
    return (
                <ul>
                    {projects.map((p) => (
                        <Project project={p} key={p.id} />
                    ))}
                </ul>

    );
}
